Melanie Georgacopoulos is now available at Dover Street Market New York. In-store only.
 
Melanie creates jewelry that redefines our perceptions of the pearl. Included in our curation is her Carats collection, a family of pieces that celebrate natural clam pearls and natural diamonds. Diamonds appear to be spontaneously pushed into ‘cushions’ of mother of pearl in cuffs and earrings, it is also layered to create a fishbone pattern that adorns the top of a ring or is set with diamonds in a one-of-a-kind carved cuff.

@melaniegeorgacopoulos

