Cecilie Bahnsen x The North Face arrives Thursday, March 13th at Dover Street Market New York and on the DSMNY E-SHOP, 12PM EST.

The collection showcases performance fabrics enhanced by technical finishes, brought to life through Cecilie Bahnsen’s signature intricate detailing. Each silhouette embodies sculptural volume and effortless lightness. Designed for both exploration and elegance, the outerwear pieces serve as protective layers over delicate, cloud-like forms. Blending function, durability, and femininity.

@ceciliebahnsen
@thenorthface
@thenorthface_city

