Slawn x Nike Air Max 90 arrives Friday, April 4th at Dover Street Market New York and on the DSMNY E-SHOP.
 
Slawn, Nigerian artist and designer, teams up with Nike to put his own spin on the Air Max 90. Known for large-scale paintings, sculptures and design, Slawn takes the iconic sneaker to another dimension with a generous dose of speckling and texture.

 
An embossed design adds depth and complexity, while the revamped mudguard creates a more streamlined look. Mixing real and synthetic leather in a stealthy black / clean cream colorway, the Air Max 90 comes complete with Max Air cushioning for supreme comfort. Lace up and give a nod to Slawn and his ingenious reimagining of an all-time classic.
 
@nike 
@nikenyc
@olaoluslawn

